Evenement.227593X33X340:
Documents  diffusés le 01 mars 2019 par les porteurs du projet aux établissements  en vue des nouveaux examens par les comités techniques et des prochains conseils :
- un rapport de présentation ;
- le projet de décret créant l'Institut Polytechnique de Paris et en approuvant les statuts ;
- le projet de statuts de cet établissement expérimental.

S'y ajoutent, pour  information au MESRI, des fichiers présentant les marques des révisions apportées au projet de décret et au projet de statuts par rapport aux versions  transmises le 19/02 par la DGESIP.
